import styled from 'styled-components';

const HomeContainer = styled.div`
    .flex;
    .items-center;
    .justify-center;
    .flex-col;
    .text-pwhite;
    span {
        .text-pdark
    }
`
const PhotoContainer = styled.div`
    .mt-12;
    height: 35vh;
    width: 35vh;
    .p-4;
    border-radius: 50%;
    border: 5px solid #fff;
`;

const Photo = styled.img`
    max-height: 100%
`;

const Intro = styled.div`
    width: 70vw;
    .text-2xl;
    .mt-8;
    .text-center;
`;

const Span = styled.span`
    .text-pdark;
    .text-bold;
    font-weight: 700;
`;

const Home = () => {
    return (
        <HomeContainer>
            <PhotoContainer>
                <Photo src="/logo.png" alt="Vilva Athiban P B, The JS Jockey" />
            </PhotoContainer>    
            <Intro>
                I am <Span>Vilva</Span>, a JavaScript developer, International tech Speaker, Open Source Contributor, Seasonal Blogger and YouTuber. 
                <br />I Fell in love ❤️ with JavaScript and never broke up with it. 
                <br />Get connected to me or Go around the website to know more about me
            </Intro>
        </HomeContainer>
    );
}

export default Home;
